import React, { useState } from "react";
import { Search } from "lucide-react";

function Admin() {
  const [searchTerm, setSearchTerm] = useState("");

  const handleSearchChange = (e) => {
    setSearchTerm(e.target.value);
  };

  const handleSearch = () => {
    console.log("Searching for:", searchTerm);
    // Aqui você pode implementar a lógica de pesquisa futuramente
  };

  return (
    <div className="p-4 grid gap-6">
      <div className="bg-white shadow-md rounded-lg p-6">
        <div className="flex flex-col gap-4">
          <h1 className="text-xl font-bold">Admin de Projetos</h1>

          {/* Botões das funcionalidades */}
          <div className="flex gap-4">
            <button className="bg-blue text-white hover:bg-blue-600 px-4 py-2 rounded" style={"backgroundcolor"}>
              Adicionar Novo Projeto    
            </button>
            <button className="bg-yellow-500 text-white hover:bg-yellow-600 px-4 py-2 rounded">
              Editar Projeto
            </button>
            <button className="bg-red-500 text-white hover:bg-red-600 px-4 py-2 rounded">
              Listar/Excluir Projetos
            </button>
          </div>

          {/* Barra de pesquisa */}
          <div className="flex items-center gap-2 mt-4">
            <input
              type="text"
              placeholder="Pesquise um projeto"
              value={searchTerm}
              onChange={handleSearchChange}
              className="flex-grow border border-gray-300 rounded px-2 py-1"
            />
            <button
              className="bg-gray-500 text-white hover:bg-gray-600 flex items-center gap-2 px-4 py-2 rounded"
              onClick={handleSearch}
            >
              <Search className="w-4 h-4" /> Pesquisar
            </button>
          </div>
        </div>
      </div>
    </div>
  );
}

export default Admin;
